import React, { useState } from "react";
import ApiService from "../../service/ApiService";

const PrediccionPage = () => {
  const [form, setForm] = useState({
    leadTime: 30,
    arrivalDateMonth: "May",
    staysInWeekendNights: 2,
    staysInWeekNights: 3,
    adults: 2,
    children: 1,
    babies: 0,
    previousCancellations: 0,
    bookingChanges: 1,
    depositType: "No Deposit",
    customerType: "Transient",
    reservedRoomType: "A",
    assignedRoomType: "A"
  });

  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({
      ...prev,
      [name]: isNaN(value) || name === "arrivalDateMonth" || name === "depositType" || name === "customerType" || name === "reservedRoomType" || name === "assignedRoomType"
        ? value
        : Number(value),
    }));
  };

  const handlePredecir = async () => {
    try {
      setLoading(true);
      const resultadoPrediccion = await ApiService.predecirCancelacion(form);
      setResultado(resultadoPrediccion);
    } catch (error) {
      alert("Error al obtener la predicción.");
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-4 max-w-xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Formulario de Predicción</h1>

      <form className="space-y-3">
        <div className="grid grid-cols-2 gap-4">
          <input name="leadTime" type="number" value={form.leadTime} onChange={handleChange} placeholder="Lead Time" className="border p-2 rounded" />
          <select name="arrivalDateMonth" value={form.arrivalDateMonth} onChange={handleChange} className="border p-2 rounded">
            {["January","February","March","April","May","June","July","August","September","October","November","December"].map(m => (
              <option key={m} value={m}>{m}</option>
            ))}
          </select>
          <input name="staysInWeekendNights" type="number" value={form.staysInWeekendNights} onChange={handleChange} placeholder="Noches fin de semana" className="border p-2 rounded" />
          <input name="staysInWeekNights" type="number" value={form.staysInWeekNights} onChange={handleChange} placeholder="Noches entre semana" className="border p-2 rounded" />
          <input name="adults" type="number" value={form.adults} onChange={handleChange} placeholder="Adultos" className="border p-2 rounded" />
          <input name="children" type="number" value={form.children} onChange={handleChange} placeholder="Niños" className="border p-2 rounded" />
          <input name="babies" type="number" value={form.babies} onChange={handleChange} placeholder="Bebés" className="border p-2 rounded" />
          <input name="previousCancellations" type="number" value={form.previousCancellations} onChange={handleChange} placeholder="Cancelaciones previas" className="border p-2 rounded" />
          <input name="bookingChanges" type="number" value={form.bookingChanges} onChange={handleChange} placeholder="Cambios de reserva" className="border p-2 rounded" />
          <select name="depositType" value={form.depositType} onChange={handleChange} className="border p-2 rounded">
            {["No Deposit", "Refundable", "Non Refund"].map(d => (
              <option key={d} value={d}>{d}</option>
            ))}
          </select>
          <select name="customerType" value={form.customerType} onChange={handleChange} className="border p-2 rounded">
            {["Transient", "Contract", "Transient-Party", "Group"].map(c => (
              <option key={c} value={c}>{c}</option>
            ))}
          </select>
          <select name="reservedRoomType" value={form.reservedRoomType} onChange={handleChange} className="border p-2 rounded">
            {["A", "B", "C", "D", "E", "F", "G", "H", "L"].map(r => (
              <option key={r} value={r}>{r}</option>
            ))}
          </select>
          <select name="assignedRoomType" value={form.assignedRoomType} onChange={handleChange} className="border p-2 rounded">
            {["A", "B", "C", "D", "E", "F", "G", "H", "L"].map(r => (
              <option key={r} value={r}>{r}</option>
            ))}
          </select>
        </div>

        <button
          type="button"
          onClick={handlePredecir}
          className="bg-blue-600 text-white px-4 py-2 rounded w-full"
          disabled={loading}
        >
          {loading ? "Procesando..." : "Predecir Cancelación"}
        </button>
      </form>

      {resultado && (
        <div className="mt-6 p-4 border rounded bg-gray-50">
          <p><strong>¿Cancelará?</strong> {resultado.cancelara ? "Sí" : "No"}</p>
          <p><strong>Confianza:</strong> {Math.round(resultado.confianza * 100)}%</p>
        </div>
      )}
    </div>
  );
};

export default PrediccionPage;
